import React from 'react';
import Button from '@material-ui/core/Button';
import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Link from '@material-ui/core/Link';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import DateFnsUtils from '@date-io/date-fns';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import InputLabel from '@material-ui/core/InputLabel';
import {
  MuiPickersUtilsProvider,
  KeyboardTimePicker,
  KeyboardDatePicker,
} from '@material-ui/pickers';
import 'date-fns';


export default class Form extends React.Component{

state = {
title: '',
description: '',
duedate: '',


status: '',
}

render(){

return(
<body>
<meta
  name="viewport"
  content="minimum-scale=1, initial-scale=1, width=device-width, shrink-to-fit=no" />
<Container maxWidth="sm">
<Box my={4}>
<form>
<TextField label="Title" value={this.state.title} onChange={e => this.setState({title: e.target.value})} ></TextField> <br /> <br />
<TextField label="Description" multiline={true} value={this.state.description} onChange={e => this.setState({description: e.target.value})} > </TextField> <br /><br />
<TextField label="Date" type="date"
InputLabelProps={{
          shrink: true,
        }}

onChange={e => this.setState({description: e.target.duedate})} > </TextField> 

<InputLabel htmlFor="age-simple">Age</InputLabel>
        <Select
          value={this.state.status}
          onChange={e => this.setState({status: e.target.value})}
          inputProps={{
            name: 'age',
            id: 'age-simple',
          }}
        >
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select><br /> <br />
 <Button variant="contained" color="primary">
      Submit
    </Button>
</form>
 </Box>
</Container>
</body>
);

}
}
